// Start.js
import React from 'react';

const Start = ({ number, plus, miners, resetNumber, maxNumber, minNumber }) => {
  return (
    <div>
      <h1>{number}</h1>
      <button onClick={plus} disabled={number >= maxNumber}>숫자 올리기</button>
      <button onClick={miners} disabled={number <= minNumber}>숫자 내리기</button>
      <button onClick={resetNumber}>리셋</button>
    </div>
  );
};

export default Start;
